"     <div class=\"reference\">",
"      National Heart, Lung, and Blood Institute; National Asthma Education and Prevention Program Asthma and Pregnancy Working Group, &ldquo;NAEPP Expert Panel Report. Managing Asthma During Pregnancy: Recommendations for Pharmacologic Treatment - 2004 Update,&rdquo;",
"      <i>",
"       J Allergy Clin Immunol",
"      </i>",
"      ,  2005, 115(1):34-46.",
"      <span class=\"pubmed-id\">",
