"     <div class=\"reference\">",
"      Reinus JF, Persky S, Burkiewicz JS, et al, &ldquo;Severe Liver Injury After Treatment With the Leukotriene Receptor Antagonist Zafirlukast,&rdquo;",
"      <i>",
"       Ann Intern Med",
"      </i>",
"      , 2000, 133(12):964-8.",
"      <span class=\"pubmed-id\">",
