"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F235446\">",
"      Metabolism/Transport Effects",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F235393\">",
