var title_f19_54_20331="Romiplostim in chronic ITP";
var content_f19_54_20331=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F55815&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F55815&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Romiplostim increases the platelet count response in adult patients with chronic immune thrombocytopenia (ITP)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Treatment",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"3\">",
"        Overall platelet response",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Splenectomized (63)",
"       </td>",
"       <td class=\"subtitle2\">",
"        Non-splenectomized (62)",
"       </td>",
"       <td class=\"subtitle2\">",
"        Total (125)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Placebo",
"       </td>",
"       <td>",
"        0.0 percent (21)",
"       </td>",
"       <td>",
"        14.3 percent (21)",
"       </td>",
"       <td>",
"        7.1 percent (42)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Romiplostim",
"       </td>",
"       <td>",
"        78.6 percent (42)*",
"       </td>",
"       <td>",
"        87.8 percent (41)*",
"       </td>",
"       <td>",
"        83.1 percent (83)*",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Splenectomized and non-splenectomized adult patients with chronic ITP were treated for 24 weeks in a blinded, controlled study with romiplostim (AMG-531) or placebo. The overall platelet response (weekly platelet count &gt;50x10",
"    <sup>",
"     9",
"    </sup>",
"    /L for four or more of the 24 weeks of the study) is shown in this table. Numbers of patients in each group are shown in parentheses.",
"    <div class=\"footnotes\">",
"     * All comparisons were statistically significant, with p&lt;0.0001.",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Kuter DJ, Bussel JB, Lyons RM, et al. Efficacy of romiplostim in patients with chronic immune thrombocytopenic purpura: a double-blind randomised controlled trial. Lancet 2008; 371:395.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
