var title_f19_54_20333="Rx strep PVE II";
var content_f19_54_20333=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F71412&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F71412&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Suggested regimens for therapy of prosthetic valve endocarditis due to strains of viridans streptococci and Streptococcus bovis relatively or fully resistant to penicillin G (minimum inhibitory concentration &gt;0.12 &micro;g/mL)*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\" colspan=\"2\" rowspan=\"1\">",
"       American Heart Association",
"      </td>",
"      <td class=\"subtitle1\" colspan=\"1\" rowspan=\"2\">",
"       European Society of Cardiology",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2\">",
"       Adult (for patients with normal renal function)",
"      </td>",
"      <td class=\"subtitle2\">",
"       Pediatric (not to exceed dose of normal adult)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        <strong>",
"         Either",
"        </strong>",
"        aqueous penicillin G 24 million units per 24 h IV either continuously or in 4 or 6 equally divided doses for 6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         or",
"        </strong>",
"       </p>",
"       <p>",
"        Ceftriaxone&bull; 2 g/24 h IV or IM in 1 dose for 6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Gentamicin&Delta; 3 mg/kg per 24 h IV or IM in 1 dose for 6 wks (see text)",
"       </p>",
"       <p>",
"        <strong>",
"         or",
"        </strong>",
"       </p>",
"       <p>",
"        Single drug treatment",
"       </p>",
"       <p>",
"        Vancomycin&loz; 30 mg/kg per 24 h IV in 2 equally divided doses for 6 wks; not to exceed 2 g/24 h unless concentrations in serum are inappropriately low",
"       </p>",
"      </td>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        <strong>",
"         Either",
"        </strong>",
"        aqueous penicillin G 300,000 units/kg per 24 h IV in 4 or 6 equally divided doses for 6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         or",
"        </strong>",
"       </p>",
"       <p>",
"        Ceftriaxone&bull; 100 mg/kg per 24 h IV or IM in 1 dose for 6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Gentamicin&Delta; 3 mg/kg per 24 h IV or IM in 1 dose or in 3 equally divided doses for 6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         or",
"        </strong>",
"       </p>",
"       <p>",
"        Single drug treatment",
"       </p>",
"       <p>",
"        Vancomycin&loz; 40 mg/kg per 24 h IV in 2 or 3 equally divided doses for 6 wks",
"       </p>",
"      </td>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        <strong>",
"         Either",
"        </strong>",
"        aqueous penicillin G 24 million units per 24 h IV in 6 equally divided doses for 6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         or",
"        </strong>",
"       </p>",
"       <p>",
"        Amoxicillin 200 mg/kg per 24 h IV in 4 to 6 equally divided doses for 6 wks",
"       </p>",
"       <p>",
"        <strong>",
"         or",
"        </strong>",
"       </p>",
"       <p>",
"        Ampicillin 12 g per 24 h (or 200 mg/kg per 24 h) in 6 equally divided doses for 6 weeks",
"       </p>",
"       <p>",
"        <strong>",
"         or",
"        </strong>",
"       </p>",
"       <p>",
"        Vancomycin&loz; 30 mg/kg per 24 h IV in 2 doses for 4 wks",
"       </p>",
"       <p>",
"        <strong>",
"         plus",
"        </strong>",
"       </p>",
"       <p>",
"        Gentamicin&Delta; 3 mg/kg per 24 h IV or IM in 1 dose for first 2 wks (see text)",
"       </p>",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     IV: intravenously; IM: intramuscularly; h: hours; wks: weeks",
"     <br>",
"      * European society of cardiology (ESC) guideline recommendations are applicable to strains having penicillin MIC 0.125 &micro;g/mL up to 2 &micro;g/mL.",
"      <br>",
"       &bull; Alternative in patients with non-immediate penicillin allergy; preferred for outpatient therapy; IM administration is painful.",
"       <br>",
"        &Delta; In adults aminoglycosides are dosed based on ideal body weight. Renal function and serum gentamicin concentrations should be monitored at least once per week. When given in a single daily dose, pre-dose (trough) concentrations should be &lt; 1 &micro;g/mL.",
"        <br>",
"         &loz; Vancomycin therapy only recommended for patients allergic to penicillin and cephalosporins. In adults vancomycin is dosed based on actual body weight. The dose should be adjusted for peak serum concentrations (1 h after infusion) of 30-45 &micro;g/mL and trough concentration of 15-20&nbsp;&micro;g/mL. The dose may need to be increased beyond 30 mg/kg actual body weight and frequency may need to be increased to 3 equally divided doses.",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     <p>",
"      1. Baddour, LM, Wilson, WR, Bayer, AS, et al. Infective endocarditis: Diagnosis, antimicrobial therapy, and management of complications: A statement for healthcare professionals from the committee on rheumatic fever, endocarditis, and Kawasaki disease, council on cardiovascular disease in the young, and the councils on clinical cardiology, stroke, and cardiovascular surgery and anesthesia, American Heart Association--executive summary: endorsed by the Infectious Diseases Society of America. Circulation 2005; 111:3167.",
"      <br>",
"       2. Habib G, Hoen B, Tornos P, et al. Guidelines on the prevention, diagnosis, and treatment of infective endocarditis (new version 2009): the Task Force on the Prevention, Diagnosis, and Treatment of Infective Endocarditis of the European Society of Cardiology (ESC). Endorsed by the European Society of Clinical Microbiology and Infectious Diseases (ESCMID) and the International Society of Chemotherapy (ISC) for Infection and Cancer. Eur Heart J 2009; 30:2369.",
"       <br>",
"        3. Liu, Catherine et al Clinical Practice guidelines by the Infectious Disease Society of America for the Treatment of Methicillin- Resistant Staphylococcus aureus Infections in Adults and Children. CID 2011; 52; 285-292.",
"       </br>",
"      </br>",
"     </p>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
